        <div>
            <img src= {`../images/${props.coverImg}`} />
           <div>
            <span>{props.rating}</span>   
            <span>{props.reviewCount}</span>   
            <span>{props.location}</span>   
            </div> 
            <h3>from ${props.price} / person</h3>
        </div>
    )
}
